import React, {Component} from 'react';
import './App.css';

class App extends Component {
    render() {
        return (
            <div className={"blackBack"}>
                <div className='navbar'>
                    <div className='logo'>Where to Eat ?</div>
                    <div className='seal'/>
                </div>
                <div className={"buttons"}>
                    <h1>Welcome to where to eat!</h1>
                    <p className={"summaryPara"}>
                        <br/>
                        Our aim is to simplify the decision for you and your
                        friends as to where to eat.
                        <br/>
                        To get started, create a form for your friends, or
                        if you have recieved a code
                        <br/>
                        from your friend, go ahead and enter that!
                    </p>
                    <div className="icon-search-container"
                         data-ic-class="search-trigger">
                        <span className="fa fa-search"></span>
                        <input type="text" className="search-input"
                               data-ic-class="search-input"
                               placeholder="Search"/>
                        <span className="fa fa-times-circle"
                              data-ic-class="search-clear"></span>
                    </div>
                    <button className={"button-submit"} onClick={"test"}>Create Form</button>

                    <button className={"button-submit"}>Enter code</button>

                </div>
            </div>
        );

        function test(){

            var searchTrigger = ('[data-ic-class="search-trigger"]'),
                searchInput = ('[data-ic-class="search-input"]'),
                searchClear = ('[data-ic-class="search-clear"]');

            searchTrigger.click(function(){

                var searchTrigger = ('[data-ic-class="search-trigger"]');
                searchTrigger.addClass('active');
                searchInput.focus();

            });

            searchInput.blur(function(){

                if(searchInput.val().length > 0){

                    return false;

                } else {

                    searchTrigger.removeClass('active');

                }

            });

            searchClear.click(function(){
                searchInput.val('');
            });

            searchInput.focus(function(){
                searchTrigger.addClass('active');
            });

        };
    }
}

export default App;
